MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "Attributes can be attached to modeling objects to assign thermally significant properties to the objects or, in the case of grid constraints, to improve the resolution of the results.");
MGCAddSnippet(5, "The following paragraphs summarize the usage of the attribute types available in SimcenterFlotherm software.");
MGCAddSnippet(6, "Attributes can be classified as project attributes and library attributes depending on how they are stored.");
MGCAddSnippet(7, "Attributes attached to objects are shown in the Attachments tab of an object s property sheet.");
MGCAddSnippet(8, "Attributes are managed using the Attachments tab of object property sheets, and the Project Attributes and Library trees.");
MGCAddSnippet(9, "You can create an attribute without having to attach it to an object. The attribute is then available within the project for future use.");
MGCAddSnippet(10, "New attributes created from an object property sheet are attached to the object.");
MGCAddSnippet(11, "Library attributes added to project attributes are available for attaching to objects.");
MGCAddSnippet(12, "Attributes must be attached to objects for them to take effect.");
MGCAddSnippet(13, "Surface, Surface Exchange and Radiation attributes can be attached to surfaces of primitive geometry (cuboids, prisms, tets, and inverted tets).");
MGCAddSnippet(14, "Highlight objects in the project data tree that have a particular attached attribute.");
MGCAddSnippet(15, "You must detach an attribute before it can be deleted.");
MGCAddSnippet(16, "Flushing unattached project attributes clears out any unused attributes from the Project Attributes tree.");
MGCAddSnippet(17, "You can make a copy of an attribute, which can then be edited, to avoid having to create an attribute from scratch.");
MGCAddSnippet(18, "You can delete attributes from the Project attributes tree or from the Library tree.");
MGCAddSnippet(19, "A project attribute saved to a library ensures that the attribute is available for other projects.");
MGCAddSnippet(20, "In addition to changing the name in the attribute property sheet you can also change the name by direct editing.");
MGCAddSnippet(21, "The ambient conditions can be refined for a particular face of the solution domain, or any cutout on it, by attaching an Ambient attribute.");
MGCAddSnippet(22, "The default ambient conditions are those set in the Global System Settings section of the Model Setup tab. These are the datum pressure (Pressure), fluid temperature (Default Ambient Temperature) and temperature of a remote radiating source (Default Radiant Temperature).");
MGCAddSnippet(23, "The ambient temperature is, by default, the temperature of the fluid, usually air, that flows into the solution domain. The ambient temperature is also used to calculate heat flow through enclosure walls at the solution domain boundary.");
MGCAddSnippet(24, "The pressure setting can be used to define boundary conditions for an enclosure with a known pressure difference from inlet to outlet.");
MGCAddSnippet(25, "When the KE model is active you can define turbulence by setting the Turbulent Kinetic Energy, K, and the Turbulent Dissipation Rate, e.");
MGCAddSnippet(26, "The value for H can be specified according to the standard free and forced convection correlations found in most heat transfer text books.");
MGCAddSnippet(27, "The external velocity values are used to specify the magnitude and direction of the free stream, external to the system being modeled.");
MGCAddSnippet(28, "The radiant temperature is used when there are more than one remote radiating sources to model.");
MGCAddSnippet(29, "Use this property sheet to set the ambient conditions that prevail outside the overall solution domain. ");
MGCAddSnippet(30, "Control attributes can only be attached to Control objects and define sets of power versus temperature curves for different frequencies.");
MGCAddSnippet(31, "The Control attribute enables power to be controlled as the temperature hits specific values.");
MGCAddSnippet(32, "Use this file to set up a frequency-based power source which varies with temperature.");
MGCAddSnippet(33, "Use this file to export multiple control curves from a control attribute definition.");
MGCAddSnippet(34, "Descriptions of the property sheet and power versus temperature charts used when defining control attributes.");
MGCAddSnippet(35, "Use this property sheet to define control curves for frequency-based power control.");
MGCAddSnippet(36, "Use this chart to examine the set of defined control curves, and to export the data points of those curves.");
MGCAddSnippet(37, "Use this chart to plot a power control curve for a particular frequency. The title bar of the chart displays the frequency.");
MGCAddSnippet(38, "In addition to the model default fluid (usually air), other fluids can be defined within the model.");
MGCAddSnippet(39, "The default fluid used to represent the circulating fluid (normally air) is defined in the Model Setup tab by a Fluid attribute.");
MGCAddSnippet(40, "In addition to a default fluid, other fluids can be defined in the model as Fluid attributes attached to volume Region SmartParts to create multi-fluid regions.");
MGCAddSnippet(41, "Modeling of fluids includes setting values for the conductivity, viscosity, density, and specific heat. The conductivity, viscosity, and density values can be set as constant or temperature-dependent.");
MGCAddSnippet(42, "Thermal conductivity in fluids is dependent on whether flow is laminar or turbulent.");
MGCAddSnippet(43, "Temperature-dependency of conductivity is rarely required for dilute gases such as air.");
MGCAddSnippet(44, "Viscosity is dependent on whether flow is laminar or turbulent.");
MGCAddSnippet(45, "Generally, a constant fluid density is assumed throughout the domain of integration, however, if the density variations because of temperature or molecular weight are thought to be significant, then the Ideal Gas Law can be invoked.");
MGCAddSnippet(46, "The expansivity of the fluid is used when gravity is  on  in the expression for the Boussinesq approximation for the buoyancy force.");
MGCAddSnippet(47, "Use this property sheet to define the properties of a fluid.");
MGCAddSnippet(48, "You can apply grid constraints to individual objects using these attributes.");
MGCAddSnippet(49, "Grid constraints allow you to attach minimum grid requirements to an item of geometry to ensure adequate grid coverage wherever it is located in the calculation domain.");
MGCAddSnippet(50, "You can specify a Minimum Size (previously called Keypoint Tolerance) to make sure that grid cells smaller than this value are never created.");
MGCAddSnippet(51, "Minimum grid size is set at system and object levels.");
MGCAddSnippet(52, "If two keypoints are closer than the specified tolerance, in a particular direction, then they are treated as one.");
MGCAddSnippet(53, "Consider applying the grid constraints to a basic cuboid. By default, the program aligns the grid lines along the cuboid boundary.");
MGCAddSnippet(54, "When setting a grid constraint to a maximum grid size, if there are grid cells covering the object that are larger than the maximum grid size, the grid cell density is increased so that the grid spacing is decreased to agree with the grid constraint size.");
MGCAddSnippet(55, "Use grid inflation to add extra grid cells to the sides of objects, thereby enabling closer monitoring near surfaces.");
MGCAddSnippet(56, "Where objects with attached grid constraints are coincident, the stricter constraint takes precedence.");
MGCAddSnippet(57, "Grid constraints define the minimum grid requirement across selected geometry, that is, objects, assemblies, and cutouts on the solution domain.");
MGCAddSnippet(58, "Use this procedure when you want to maintain a number of grid cells between a pair of items.");
MGCAddSnippet(59, "Use this property sheet to define a grid constraint that can be attached to modeling objects.");
MGCAddSnippet(60, "Material properties can be applied to most modeling objects by direct attachment of a Material attribute in the Attachments tab of the object s property sheet.");
MGCAddSnippet(61, "A Surface attribute can be attached to a Material attribute by selection in the Material Attribute property sheet.");
MGCAddSnippet(62, "In addition to specifying the density and specific heat of a material, there is provision for specifying either constant or temperature-dependent thermal conductivity, electrical resistivity and, for solar radiation calculations, the transparency of the material.");
MGCAddSnippet(63, "The thermal conductivity for the material can be defined as a constant or temperature-dependent for isotropic, orthotropic, or bi-axial materials. X Conductivity, Y Conductivity, Z Conductivity, and Fluid Conductivity scalar fields are available for post-processing in Analyze mode.");
MGCAddSnippet(64, "If applying orthotropic conductivity to SmartParts, then decompose the SmartPart and let the local coordinates Xo, Yo, and Zo be displayed.");
MGCAddSnippet(65, "The electrical resistivity of the material can be defined as a constant or as temperature-dependent.");
MGCAddSnippet(66, "By default, all materials are opaque and all solar radiation is either reflected or absorbed.");
MGCAddSnippet(67, "The Material attribute definition includes the option to model phase change between solid and liquid.");
MGCAddSnippet(68, "Use this file to set up a thermal conductivity profile which varies with temperature.");
MGCAddSnippet(69, "Use this property sheet to define the thermal conductivity, density, specific heat of a material. You can also specify the properties that determine solar radiation transmission, reflection, and absorption by the material. ");
MGCAddSnippet(70, "Use this chart to set a thermal conductivity versus temperature profile.");
MGCAddSnippet(71, "Radiation attributes can be applied to surfaces of solid objects for when modeling radiation effects.");
MGCAddSnippet(72, "The radiation model defines the surfaces which exchange radiant energy.");
MGCAddSnippet(73, "To model radiation, you must switch on radiation modeling, select radiation surfaces and set emissivity values for those surfaces. Radiation effects are not modeled by default.");
MGCAddSnippet(74, "Use this property sheet to specify the level of detail of modeling radiative effects. ");
MGCAddSnippet(75, "By default, Resistance SmartParts are open spaces with no resistance to flow, therefore, a Resistance attribute must be attached to the SmartPart to define a resistance to flow.");
MGCAddSnippet(76, "The formula for modeling the pressure drop across either planar or volume resistance depends on the selection of Velocity type and Treatment.");
MGCAddSnippet(77, "Examples of planar resistances include grilles, meshes, and other partial obstruction to the flow that does not occupy a significant volume.");
MGCAddSnippet(78, "This example provides for using a planar resistance where the pressure drop is linear with velocity.");
MGCAddSnippet(79, "Use the following settings to model a planar resistance as a solar shield.");
MGCAddSnippet(80, "Calculation of volume resistance.");
MGCAddSnippet(81, "The Accelerated model uses an area factor within the calculations to reduce the cell area in the plane of the resistance.");
MGCAddSnippet(82, "When external angled resistance is modeled, the resistance uses the direction cosines of the flow coming into the enclosure.");
MGCAddSnippet(83, "Examples of resistance generators can be downloaded from the Related Downloads section of Support Center. These worked examples were formerly called Web Parts.");
MGCAddSnippet(84, "Use this property sheet to define the attributes of a flow resistance which can be attached to a resistance primitive present in the solution domain.");
MGCAddSnippet(85, "By default, source objects have no thermal effects. A source attribute must be attached to a source object.");
MGCAddSnippet(86, "The available source types are pressure, velocity (in an axis direction) and temperature.");
MGCAddSnippet(87, "You can use a pressure source to activate a mass flow, however, the recommended method of introducing mass flow is to use Fans or Fixed Flow Devices.");
MGCAddSnippet(88, "You can use a velocity source to create a source of momentum.");
MGCAddSnippet(89, "You can use a temperature source to create a source of heat.");
MGCAddSnippet(90, "A Potential source activates a source of electric current. Joule Heating must be enabled.");
MGCAddSnippet(91, "When transient functions are applied to sources, they can affect coefficients of linear sources.");
MGCAddSnippet(92, "Potential Source Attributes provide a means of specifying electrical conditions so that Joule heating can be calculated.");
MGCAddSnippet(93, "A non-linear relationship between power and temperature can be defined either by importing a CSV file or adding points interactively.");
MGCAddSnippet(94, "Use this file to set up a source attribute power which varies with temperature. ");
MGCAddSnippet(95, "Use this property sheet to set prescribed fluxes or fixed values for the variables that you want to apply to the selected source.");
MGCAddSnippet(96, "Use this to chart to define or examine the non-linear relationship between power and temperature of the source.");
MGCAddSnippet(97, "Surface attributes are unusual in that they can be attached directly, or indirectly via a Material attribute, depending on the type of object.");
MGCAddSnippet(98, "Surface attributes include properties that are relevant to thermal modeling, and properties that control the appearance of solid objects when rendered as solids in the drawing board (such properties are purely visual and do not affect the solution).");
MGCAddSnippet(99, "Surface attribute properties are generally described in the Surface attribute property sheet description, further detail is provided here.");
MGCAddSnippet(100, "A palette of basic colors is available for selection. If these colors are not suitable, then you can create a new color and add it to the Custom Colors palette.");
MGCAddSnippet(101, "Use this property sheet to define the property attributes of a surface finish and choose its display representation.");
MGCAddSnippet(102, "Use this dialog box to add or modify colors for a surfaces with surface attributes when they are displayed in the drawing board. ");
MGCAddSnippet(103, "Surface Attributes should only be used when you are absolutely certain about the settings being applied and under advice from Mentor Graphics Support.");
MGCAddSnippet(104, "By default, Simcenter Flotherm uses the wall functions to determine the heat transfer coefficient at the surface of an object as part of the standard solution. Surface exchange attributes overwrite this value by fixing the heat transfer coefficient to a surface or volume based method.");
MGCAddSnippet(105, "There are two methods of setting the surface exchange attribute: by setting only the heat transfer coefficient and allowing the reference temperature to be calculated (Calculated method), or by setting the heat transfer coefficient and a reference temperature (Specified method).");
MGCAddSnippet(106, "The volume heat transfer method explained.");
MGCAddSnippet(107, "Volume heat transfer is calculated either using a constant heat transfer coefficient or by the interpolation of heat transfer coefficient from a chart (profile).");
MGCAddSnippet(108, "How to obtain a single heat transfer coefficient value, that can be applied to the compact model base cuboid.");
MGCAddSnippet(109, "A non-linear relationship between thermal resistance and airflow velocity can be defined either by importing a CSV file or adding points interactively.");
MGCAddSnippet(110, "Use this file to set up a varying thermal resistance with speed of flow. ");
MGCAddSnippet(111, "Use this property sheet to attach a heat transfer coefficient to objects.");
MGCAddSnippet(112, "Use this to chart to define or examine the coefficient profile varying with speed.");
MGCAddSnippet(113, "By default, cuboids, prisms, tets, inverted tets, cylinders, sloping blocks, enclosures, and blocks with holes are non-conducting. To thermally model these objects, you must attach thermal attributes.");
MGCAddSnippet(114, "When thermal attributes are attached to objects they can represent the heat transfer from the object according to different models.");
MGCAddSnippet(115, "Use this property sheet to define the thermal modeling of solid objects, sloping blocks, enclosures, and blocks with holes.");
MGCAddSnippet(116, "A Transient attribute can be set to vary with time, with temperature or with both.");
MGCAddSnippet(117, "Transient attributes are commonly attached to another attribute which they then modify.");
MGCAddSnippet(118, "For transient attributes that vary with time, you can define the variation as a profile or by function, where the function is created by combining instances of standard sub-function templates.");
MGCAddSnippet(119, "Functions are created by combing sub-functions. A set of mathematical sub-functions is provided.");
MGCAddSnippet(120, "When more than one sub-function is defined over the same time interval they are combined by addition or by multiplication.");
MGCAddSnippet(121, "Periodic functions are defined by the Start Time of the period (T start) and the End Time of the period (T end).");
MGCAddSnippet(122, "Transient function attributes can be made up of any number of elementary functions which may follow sequentially or overlap.");
MGCAddSnippet(123, "The start and end points of all defined transient sub-functions are keypointed in the time grid to provide an accurate description of the overall function.");
MGCAddSnippet(124, "Variations with temperature can be used to model systems whose power is derated when a component or case exceeds a specified temperature.");
MGCAddSnippet(125, "The use of hysteresis loops enables more realistic temperature control methods, commonly used in electronics, to be simulated.");
MGCAddSnippet(126, "Use these procedures to define how transient multipliers vary with time or temperature.");
MGCAddSnippet(127, "Although you can combine the attribute value and the multiplier in any number of ways, the simplest method is described.");
MGCAddSnippet(128, "Transients can vary with time or with the temperature from a monitor point.");
MGCAddSnippet(129, "You can specify data points either by direct entry in a chart table or by importing the point values from CSV files.");
MGCAddSnippet(130, "You can specify data points either by direct entry in a chart table or by importing the point values from CSV files.");
MGCAddSnippet(131, "Two profiles are created by fitting curves to two supplied sets of data points.");
MGCAddSnippet(132, "Functions can be simple, single subfunctions or complex combinations of subfunctions.");
MGCAddSnippet(133, "Time-varying transients, can be set up to be periodic, that is, at the end of the profile or function, the profile/function is repeated.");
MGCAddSnippet(134, "In this example a transient attribute is defined to vary a heat source between 2 and 5 Watts linearly from 0 and 15 seconds. The required multiplication factor of the transient is then calculated to vary from 0.4 (2/5) to 1 (5/5).");
MGCAddSnippet(135, "You have the option of defining a transient profile by specifying plot coordinates in a CSV file.");
MGCAddSnippet(136, "Use this file to set up a transient attribute profile which varies with time. ");
MGCAddSnippet(137, "Use this file to set up a transient attribute profile which varies with temperature. ");
MGCAddSnippet(138, "This section describes the property sheet and time-dependent and temperature-dependent charts used when defining transient attributes.");
MGCAddSnippet(139, "Use this property sheet to define a transient variation with time, temperature, or both.");
MGCAddSnippet(140, "Use this property sheet to define a function over time, either by specifying a profile or a mathematical function. A function can be a combination of sub-functions.");
MGCAddSnippet(141, "Use this property sheet to select a monitor point whose temperature will be used to define a transient multiplier function.");
MGCAddSnippet(142, "Use this chart to confirm the profile of the multiplier variation with time derived by combining sub-functions.");
MGCAddSnippet(143, "Use this chart to confirm the profile of the multiplier variation with time created by a sub-function.");
MGCAddSnippet(144, "Use this chart to create or confirm the profile of the multiplier variation with time.");
MGCAddSnippet(145, "Use this chart to set a profile, or two profiles to model hysteresis.");

